def extract_cities_from_text(text):
    cities_found = []
    words = text.lower().split()
    for word in words:
        if city_to_state_map.get(word):
            cities_found.append(word)
    return cities_found

def map_cities_to_states(cities):
    # return [{"city": city, "state": city_to_state_map[city]} for city in cities]
    dict = {}
    for city in cities:
        dict[city] = city_to_state_map[city]
    return dict



def extract_locations_from_text(text):
    # Preprocess the text to remove non-alphanumeric characters except whitespace
    cleaned_text = re.sub(r'[^\w\s]', '', text)
    extracted_cities = extract_cities_from_text(cleaned_text)
    cities_and_states = map_cities_to_states(extracted_cities)
    return cities_and_states


